const Question = (props) => {
    const {data} = props;
    if (_.isEmpty(data))
    return (
        <>
            <div className="question">How are you ?</div>
            <div className="answer">
                <div className="A-child">answer 1</div>
                <div>answer 1</div>
                <div>answer 1</div>
            </div>
        </>
    )
}

export default Question;
